import React from 'react';

interface User {
  id: number;
  username: string;
  email: string;
  sold: number;
}

const dummyUser: User = {
  id: 1,
  username: 'alex23',
  email: 'alex23@example.com',
  sold: 250.75,
};

const Profile: React.FC = () => {
  const user = dummyUser;

  const handleLogout = () => {
    alert('Logout realizat.');
    // Aici poÈ›i pune redirect sau altÄƒ logicÄƒ
  };

  return (
    <div
      style={{
        minHeight: '100vh',
        backgroundImage: "url('/images/background-casino.jpg')",
        backgroundSize: 'cover',
        backgroundPosition: 'center',
        backgroundRepeat: 'no-repeat',
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'flex-start',
        paddingTop: '4rem',
        paddingBottom: '4rem',
      }}
    >
      <div
        style={{
          maxWidth: '480px',
          width: '100%',
          backgroundColor: 'rgba(255, 255, 255, 0.9)',
          padding: '2.5rem 2rem',
          borderRadius: '16px',
          boxShadow: '0 20px 25px -5px rgba(0,0,0,0.1)',
          userSelect: 'none',
          color: '#374151',
          fontFamily: "'Segoe UI', Tahoma, Geneva, Verdana, sans-serif",
        }}
      >
        <h1
          style={{
            fontSize: '2rem',
            fontWeight: '700',
            marginBottom: '2rem',
            textAlign: 'center',
            color: '#059669',
            userSelect: 'text',
          }}
        >
          ðŸ‘¤ Profil Utilizator
        </h1>

        <div style={{ marginBottom: '1.5rem' }}>
          <p style={{ marginBottom: '0.75rem', fontWeight: '600' }}>
            <span style={{ color: '#059669' }}>Username:</span>{' '}
            <span style={{ fontWeight: '400', userSelect: 'text' }}>{user.username}</span>
          </p>
          <p style={{ marginBottom: '0.75rem', fontWeight: '600' }}>
            <span style={{ color: '#059669' }}>Email:</span>{' '}
            <span style={{ fontWeight: '400', userSelect: 'text' }}>{user.email}</span>
          </p>
          <p style={{ fontWeight: '600' }}>
            <span style={{ color: '#059669' }}>Sold cont:</span>{' '}
            <span style={{ fontWeight: '700', color: '#065f46' }}>
              {user.sold.toLocaleString('ro-RO', { minimumFractionDigits: 2, maximumFractionDigits: 2 })} RON
            </span>
          </p>
        </div>

        <button
          onClick={handleLogout}
          style={{
            marginTop: '2rem',
            width: '100%',
            backgroundColor: '#ef4444',
            color: 'white',
            padding: '0.75rem',
            border: 'none',
            borderRadius: '12px',
            cursor: 'pointer',
            fontWeight: '700',
            fontSize: '1.1rem',
            transition: 'background-color 0.3s ease',
            userSelect: 'none',
          }}
          onMouseEnter={(e) => (e.currentTarget.style.backgroundColor = '#b91c1c')}
          onMouseLeave={(e) => (e.currentTarget.style.backgroundColor = '#ef4444')}
        >
          Logout
        </button>
      </div>
    </div>
  );
};

export default Profile;
